import React from 'react'
import { BrowserRouter, Router, Routes, Route } from 'react-router-dom';
import './navbar.css';
import Header from '../Header/header';
import AboutMe from '../AboutMe/aboutme';

const Navbar = () => {
  return (
    <nav className='navbar'>
        <div>
            <Routes>
              <Route path="/Home" element={<Header />} className='navBarItem'>Home</Route>
              <Route path="/AboutMe" element={<About Me />} className='navBarItem'>About Me</Route>
            </Routes>
            {/* <Link to={Header} className='navbarItem'>Home</Link> */}
            {/* <Link to="./AboutMe" className='navbarItem'>About Me</Link> */}
        </div>
        <div>
          <Routes>
              <Route className='navBarItem'>Experience</Route>
              <Route className='navBarItem'>Contact Me</Route>
            </Routes>
            {/* <Link className='navbarItem'>Experience</Link> */}
            {/* <Link className='navbarItem'>Contact Me</Link> */}
        </div>
    </nav>
  )
}

export default Navbar
